const Dashboard = () => {
  return (
    <div>
      <div className="m-2   box-border h-auto  border-4 px-2 bg-yellow-300 rounded-xl">
        <h1 className="text-gray-700 text-2xl ">Dashboard:</h1>
      </div>
      <h3 className="m-2 text-2xl">Dashboard</h3>
    </div>
  );
};

export default Dashboard;
